    public static string Enemy(int topTextIndex, string denIndex, string bottomText)
    {
        var leftAndRight = EnemiesAndPlayerTexts[topTextIndex].Split(',');
        var left = leftAndRight[0];
        var right = leftAndRight[1];
        return new StringBuilder()
            .Append(left)
            .Append(denIndex)
            .Append(right)
            .Append(bottomText)
            .ToString();
    }
